import React from "react";

export default function DataDiv({ data }) {
  let dataArr = JSON.stringify(data).split(",");
  let lines = dataArr.map((line) => {
    return <div>{line}</div>;
  });

  return (
    <div
      style={{
        padding: "5px 20px",
        overflowX: "scroll",
        borderRadius: "5px",
        border: "2px solid red",
        color: "rgb(200,200,200)",
        fontSize: 18,
        letterSpacing: "1.5px",
        lineHeight: "25px",
        fontWeight: 400,
      }}
    >
      {lines}
    </div>
  );
}
